import React from "react";
import { ComponentStory, ComponentMeta } from "@storybook/react";
import CreditCard from "./";
import { ThemeColor } from "./";

// More on default export: https://storybook.js.org/docs/react/writing-stories/introduction#default-export
export default {
  title: "New/CreditCard",
  component: CreditCard,
  // More on argTypes: https://storybook.js.org/docs/react/api/argtypes
  argTypes: {
    propertyA: {
      options: ['Item One', 'Item Two', 'Item Three'],
      control: { type: 'select' }, // Automatically inferred when 'options' is defined
    },
  },
} as ComponentMeta<typeof CreditCard>;

// More on component templates: https://storybook.js.org/docs/react/writing-stories/introduction#using-args
const Template: ComponentStory<typeof CreditCard> = (args) => (
  <CreditCard {...args} />
);

export const Default = Template.bind({});;

export const SolidColor = Template.bind({});
// More on args: https://storybook.js.org/docs/react/writing-stories/args
SolidColor.args = {
  theme: "green",
};



Default.parameters = { storySource: { source: "(args) => (\n  <CreditCard {...args} />\n)" }, ...Default.parameters };
